<script type="text/javascript">
  
//<![CDATA[
	$(document).ready(function(e){
	
	$("#under-control-title").text($.su.CHAR.LOGIN.UNDER_CONTROLING);
	$("#under-control-reset").text($.su.CHAR.LOGIN.UNDER_CONTROLING_TIPS);
	$("#under-control-alert .text").html($.su.CHAR.LOGIN.ALERT_TITLE + "<br />" +$.su.CHAR.LOGIN.ALERT_CONTENT);
	
	$.ajax({
		url: "./data/managedMode.json",
		type: 'GET',
		data: {},
		dataType: 'json',
		cache:false,
		error: function(){return false;},
		success: function(result){	
			if (!result.success && result.errCode == 403)
			{
				$("div#top-wrapper").show();
				$("div#under-control-container").show();
				$("#under-control-button").button("hide");
				$("#under-control-alert").show();
				//top.location.href = "/login/forbidden";
			}
			else
			{
				
				$("div#top-wrapper").show();
				$(".top-content").show();
				$("input#login-username").focus();
			}
	$.ajax({
		url: "./data/login.json",
		type: 'POST',
                        data: { "operation": "read" },
		dataType: 'json',
                        cache: false,
                        error: function () { return false; },
                        success: function (result) {
			$("span#devname").html(result.dutMode);

			$("input#login-username").focus();
			
            switch(result.error){
                case 1:
                    if(result.retryChances > 3){
				$("input#login-username").textbox("setError", $.su.CHAR.LOGIN.LOGIN_ERR_FAIL);
                    }else if(result.retryChances == 0){
                        $("input#login-username").textbox("setError", $.su.CHAR.LOGIN.LOGIN_LOCKED);
                    }else{
                        $("input#login-username").textbox("setError", $.su.CHAR.LOGIN.LOGIN_CHANGE_LEFT.replace('%num%', result.retryChances));
			}
                    break;
                case 2:
				$("input#login-username").textbox("setError", $.su.CHAR.LOGIN.LOGIN_ERR_TIMEOUT);
                    break;
                case 4:
                    $("input#login-username").textbox("setError", $.su.CHAR.LOGIN.LOGIN_ERR_INIT);
                    break;
                case 5:
                    var hours = Math.floor(result.waitTime/3600);
                    var minutes = Math.floor((result.waitTime%3600)/60);
                    var seconds = (result.waitTime%3600)%60;
                    var str;
                    var hStr = $.su.CHAR.LOGIN.HOUR;
                    var mStr = $.su.CHAR.LOGIN.MINUTE;
                    var sStr = $.su.CHAR.LOGIN.SECOND;

                    if(hours>0){
                        minutes==0?str=hours+hStr:str=hours+hStr+' '+minutes+mStr;
                        
                    }else{
                        if(minutes > 0){
                            seconds==0?str=minutes+mStr:str=minutes+mStr+' '+seconds+sStr;
                        }else{
                            str=seconds+sStr;
			}
			}
                    $("input#login-username").textbox("setError", $.su.CHAR.LOGIN.LOGIN_LOCKED_TIME.replace('%time%', str));                 
                    break;
			}
		}
	});
                }
            });


    $("input#login-username").textbox({
        hint: $.su.CHAR.LOGIN.USERNAME,
        fieldLabel: null,
        cls: "inline-block login-text",
		allowBlank: false
    });

	$("input#login-password").password({
        showLevel: false,
        hint: $.su.CHAR.LOGIN.PASSWORD,
        _maxLength: 64,
        fieldLabel: null,
        vtype: "ascii_visible",
		allowBlank: false,
        allowVisible: true,
        cls: "inline-block login-text"
    }).on("ev_change", function(e, value, key, keyCode){
        if (key == "Enter" || keyCode == 13){
            return doLogin();
        };
    });

    /*$("input#show-characters").checkbox({
        items: [
            {boxlabel: "Show Characters", inputValue: "show-characters-check", id: "show-characters-check"}
        ],
        cls: "login-show-characters"
    });*/

    $("button#login-btn").button({
        text: $.su.CHAR.LOGIN.LOGIN,
        handler: function(e){
			return doLogin();
        },
        cls: "submit login-btn inline-block"
    });
	
	var doLogin = function(){
		$("button#login-btn").focus();
	
		if (0 == $("input#login-username").textbox("getValue").length)
		{
			$("input#login-username").textbox("setError", $.su.CHAR.PORTAL.ERR_USERNAME_EMPTY);
			return false;
		}
		
		if (0 == $("input#login-password").textbox("getValue").length)
		{
			$("input#login-password").textbox("setError", $.su.CHAR.PORTAL.ERR_PWD_EMPTY);
			return false;
		}
			
		
		$("input#login-password").textbox("setValue", md5($("input#login-password").textbox("getValue")).toUpperCase());
        // $("form#form-login").submit();
        $.ajax({
            url: '/',
            type: 'POST',
            data: {
                username: $("input#login-username").textbox("getValue"),
                password: $("input#login-password").textbox("getValue")
            },
            dataType: 'json',
            success: function(data) {
                if (data.result) {
                    location = '/';
                }
            },
            fail: function() {
                location = '/';
            },
            error: function() {
                location = '/';
            }
        });
		
		return true;
	};


    $("a#btn_forget_password").html($.su.CHAR.LOGIN.FORGET_PASSWORD).on("click", function(e){

    });

